import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "./Inventory.css";

const Inventory = () => {
  const navigate = useNavigate();
  const [currentSlide, setCurrentSlide] = useState(0);

  // Battery images - Add your images to frontend/public folder
  const batteryImages = [
    {
      id: 1,
      name: "EXIDE XPLORE",
      description: "Motorcycle VRLA Battery - Super Sealed Performance, Zero Maintenance",
      image: "/battery-xplore-motorcycle.jpg"
    },
    {
      id: 2,
      name: "EXIDE XPLORE",
      description: "Motorcycle VRLA - High Performance Battery",
      image: "/battery-xplore-motorcycle-2.jpg"
    },
    {
      id: 3,
      name: "EXIDE MILEAGE",
      description: "Car Battery - Designed for Optimum Performance & Long Battery Life",
      image: "/battery-mileage-car.jpg"
    }
  ];

  // Auto-rotate carousel every 4 seconds
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentSlide((prev) => (prev + 1) % batteryImages.length);
    }, 4000);

    return () => clearInterval(interval);
  }, [batteryImages.length]);

  return (
    <div className="inventory-container">
      <div className="inventory-header">
        <h1>Our Inventory</h1>
        <p>Choose a category to browse products</p>
      </div>

      {/* Carousel Section */}
      <div className="carousel-section">
        <div className="carousel-container">
          <div 
            className="carousel-slides"
            style={{ transform: `translateX(-${currentSlide * 100}%)` }}
          >
            {batteryImages.map((battery, index) => (
              <div key={battery.id} className="carousel-slide">
                <div className="carousel-image-frame">
                  <img 
                    src={battery.image} 
                    alt={battery.name}
                    className="carousel-image"
                  />
                </div>
                <div className="carousel-caption">
                  <h3>{battery.name}</h3>
                  <p>{battery.description}</p>
                </div>
              </div>
            ))}
          </div>
          
          {/* Navigation Dots */}
          <div className="carousel-dots">
            {batteryImages.map((_, index) => (
              <button
                key={index}
                className={`carousel-dot ${index === currentSlide ? 'active' : ''}`}
                onClick={() => setCurrentSlide(index)}
                aria-label={`Go to slide ${index + 1}`}
              />
            ))}
          </div>

          {/* Navigation Arrows */}
          <button 
            className="carousel-arrow carousel-arrow-left"
            onClick={() => setCurrentSlide((prev) => (prev - 1 + batteryImages.length) % batteryImages.length)}
            aria-label="Previous slide"
          >
            &#8249;
          </button>
          <button 
            className="carousel-arrow carousel-arrow-right"
            onClick={() => setCurrentSlide((prev) => (prev + 1) % batteryImages.length)}
            aria-label="Next slide"
          >
            &#8250;
          </button>
        </div>
      </div>

      <div className="categories-grid">
        <div
          className="category-card battery-card"
          onClick={() => navigate("/products/battery")}
        >
          <div className="category-icon">ðŸ”‹</div>
          <h2>Batteries</h2>
          <p>Vehicle & Home Batteries</p>
        </div>

        <div
          className="category-card ups-card"
          onClick={() => navigate("/products/ups")}
        >
          <div className="category-icon">âš¡</div>
          <h2>UPS</h2>
          <p>Uninterruptible Power Supply</p>
        </div>
      </div>
    </div>
  );
};

export default Inventory;
